import React, { Component } from "react";
import { Icon } from "antd";

import "./index.css";
import { Link } from "react-router-dom";

export default class Footer extends Component {
  render() {
    return (
      <div id="footer">
        Footer
        <Icon
          type="mail"
          theme="filled"
          component={Link}
          to="mailto:appledcse@yahoo.com"
        />
        <Icon type="github" />
        <Icon type="linkedin" theme="filled" />
      </div>
    );
  }
}
